import React from 'react'

const Note = ({deleteNote, key ,title, content}) => {
  return (
    <div className='note'>
        <h1>{title}</h1>
        <p>{content}</p>
        <button onClick={ () => deleteNote(key)}>delete</button>
    </div>
  )
}

export default Note
